    console.log(context);
    const promise = new Promise((resolve, reject) => {
      setTimeout(() => {
        resolve({ appName: "Super APP" });
      }, 500);
    });

    return promise;
  }

  render() {
    return (
      <div>
        <h1>The main Page</h1>
        <p>
          Go to{" "}
          <Link href="/auth">
            <a> Auth</a>
          </Link>
        </p>
      </div>
    );
  }
}

export default IndexPage;
